    "door_canvas_text": MessageLookupByLibrary.simpleMessage(
      "Ишти баштоодон мурда эшик полотносундагы бардык тоскоол болуучу фурнитураны алып салуу керек: кулпуларды, кулпу тешиктерин жана эшик көзчөсүн. Андан кийин эшикти илинчектеринен алып, тегиз жана ыңгайлуу бетке жаткыруу зарыл. Эшик тик абалда турганда да иштесе болот, бирок бул анча ыңгайлуу эмес жана көбүнчө адистерге гана ылайыктуу.\n\nЭшик полотносун жылуулоо үчүн ички декоративдик каптаманы алып, андан соң полотнонун ичин пенопласт же минералдык пахта плиталары менен толтуруу керек. Бул эшик аркылуу жылуулуктун жоголушун кыйла азайтат.\n\nЭшиктин ички тарабындагы каптама алынат. Кымбат моделдерде бул брондолгон металл барак болушу мүмкүн, ал эми жөнөкөй моделдерде — фанера. Кандай болбосун, ал кадимки бурамалар менен бекитилет. Эски жылуулоочу материалды толугу менен алып салуу сунушталат.\n\nЭгер эшиктин ичинде катуулоочу кабыргалар болсо, аларга 40–45 см аралыкта тешиктерди тешип, монтаждык көбүк менен толтуруу керек. Тешиктердин диаметри көбүк баллонунун түтүгүнө туура келиши зарыл.\n\nМинералдык пахта колдонулганда полиэтиленден гидробарьер жасоо керек. Пенополистирол колдонулса, мындай тоскоолдук милдеттүү эмес. Жылуулоочу материал керектүү өлчөмдө, бир аз запас менен кесилет.\n\nАкыркы этап — жылуулоочту ички көңдөйлөргө жайгаштыруу. Эң ишенимдүү ыкма — суюк мыктар же монтаждык көбүк колдонуу. Андан соң каптама кайра орнотулуп, фурнитура коюлат жана эшик өз ордуна кайтарылат.",
