    "door_intro_text": MessageLookupByLibrary.simpleMessage(
      "Эшиктер менен терезелердин негизги максаты — имаратты сууктан коргоо, сырттан муздак абанын киришин алдын алуу жана бөлмөнүн ичиндеги жылуулукту сактоо. Терезелер көбүнчө жабык же ачылбай турган болуп турса, кире бериш эшикти биз көп ачып-жабабыз. Ошондуктан эшиктеги тыгыздоочу резиналар убакыт өткөн сайын жука болуп, натыйжалуулугун жоготуп, өз функциясын толук аткара албай калат.\n\nҮйгө жана батирге коюлган кире бериш эшиктер конструкциясы боюнча окшош болушу мүмкүн. Бирок жеке үйлөрдө эшик түз эле көчөгө чыгат, ал эми шаардагы батирлерде салыштырмалуу жылуу подъезд “буфер” болуп берет. Ошондуктан жеке үйлөрдө эшикти жылуулоо бир кыйла күчтүүрөөк болушу керек.\n\nЭшиктин ичиндеги жылуулоочу материалдын сапаты бөлмөдөгү жылуулукту сактоодо жана ыңгайлуу температураны камсыз кылууда чоң роль ойнойт.\n\nЭгер эшик полотносунун кыйшайышы же кутучанын деформациясы болсо, аны жөнгө салуу же керек болсо илинчектерди (петляларды) алмаштыруу зарыл.\nМеталл эшик блокторунда эшик полотносунун кыйшайышы көбүнчө навестердин эскиришинен улам пайда болот.\nПолотнонун периметри боюнча өзү жабышуучу молдинг колдонсо болот, бирок бул көйгөйдү толук чечүүгө жетишсиз.",
