    "door_materials_text": MessageLookupByLibrary.simpleMessage(
      "Жылуулоону баштардан мурда, кайсы материалды колдоно турганыбызды карап көрөлү.\n\nТеория жүзүндө пенопласттын ордуна экструзияланган пенополистиролду (Пеноплекс) колдонсо болот — ал тыгызыраак жана жылуулук изоляциясы жогору. Бирок баасы, мисалы, пенопластка караганда 2 эсе кымбатыраак, ал эми мындай калыңдыкта жылуулоочу эффект айырмасы анча чоң эмес.\n\nМинералдык пахта эшиктерди жылуулоодо кеңири колдонулат. Монтаждоо ыкмасы пенопласттыкына окшош, бирок маанилүү жагдай бар: эшиктер үчүн пахтанын плиталарынын ичинен тыгыз варианттарын гана тандаган туура. Алар конденсаттын таасиринен көлөмүн өзгөртпөйт. Ал эми жумшак маттар убакыт өтүшү менен отуруп, жылуулоочу касиетин жоготушу мүмкүн.\n\nАзыр базарда эшикти жылуулоого арналган арзан комплекттер бар. Бул — кутучанын же эшиктин периметри боюнча чапталуучу өзүнчө жабышуучу поролон молдинг. Сапаты орточо, бирок баасы жеткиликтүү. Көп учурда мындай тыгыздоо 1 сезонго жетет.\n\nФольгалуу изолон — эшиктерди жылуулоого эң жакшы материалдардын бири. Ал болжол менен 5 мм калыңдыктагы көбүктөлгөн полиэтиленден турат: бир бетинде фольга катмары, экинчи бетинде жабышуучу пленка бар. Бул материал бардык түрдөгү эшиктер үчүн ылайыктуу. Фольга жана көзөнөктүү структура “термос” эффектин түзүп, жылуулук изоляциясын күчөтөт.\n\nАл эми сотулуу картон (ичи көңдөй бөлмө эшиктеринин кутучаларын толтурууга арналган) кире бериш эшиктер үчүн дээрлик натыйжасыз. Андагы кагаз бекем эмес жана тез бузулат.\n\nЭшиктерди жылуулоону 3 этапка бөлүүгө болот:",
