    "door_seal_text": MessageLookupByLibrary.simpleMessage(
      "Бул үчүн жабышуучу негиздеги тыгыздоочу колдонулат — полимердик же (сейрек) поролондук. Полимердик вариантты тандаган туура, анткени анын кызмат мөөнөтү узагыраак жана натыйжалуулугу жогору. Поролон жабышма лента бир сезонго да жетпей калышы мүмкүн, эң жакшы дегенде бир жылдын ичинде эле эскирип кетет. Процесс өзү жөнөкөй: тыгыздоочту эшик полотносунун периметри боюнча чаптоо керек. Эң башкысы — бетин алдын ала сүртүп, майдан тазалап (обезжирить) коюу, ошондо тыгыздооч жакшы жабышат.\n\nЖылуулоонун натыйжалуулугу көп учурда тыгыздоочтун туура калыңдыгын тандап алууга байланыштуу. Өтө жука тыгыздооч өз функциясын толук аткарбайт, ал эми өтө калыңы эшик жабылганда илинчектерге кошумча күч түшүрүп, алардын тез эскиришине алып келет.\n\nБул маселени чечүүгө пластилин жардам берет. Аны целлофанга ороп, эшик кутучасы менен полотнонун ортосуна коюңуз. Андан соң эшикти жаап, кайра ачыңыз. Пластилинден чыккан валиктин калыңдыгы тыгыздоочтун оптималдуу калыңдыгына туура келет.",
