    "door_slopes_text": MessageLookupByLibrary.simpleMessage(
      "Откостордун жылуулук изоляциясын каалаган каптамага ылайык жасап алса болот — технологиясы бирдей.\n\nИш жүргүзүү ыкмасына жараша үч вариант айырмаланат:\n1) Цемент эритмесин же шпаклевка аралашмасын түз эле дубалга сүйкөө;\n2) Каптама элементтерин клей же эритме менен жабыштыруу;\n3) Каптама элементтерин каркас аркылуу бекитүү.\n\nЖылуулоочу материал эшик полотносунун түрүнө жана бөлмөнүн ичиндеги дубал каптамасына жараша тандалат. Катмарлар канчалык көп болсо, эшик ойугунун жылуулоосу ошончолук жакшы болот. Үстүңкү катмар катары боёк, обой, декоративдик шыбак, пластик, жыгач, ламинат, МДФ, ПВХ панелдер колдонулат.\n\nИш баштардан мурда эшикти коргоочу пленка менен жаап коюңуз. Эшик кутучасынын четинен чыгып турган монтаждык көбүктү кеңсе бычагы менен этият кесип алыңыз.\n\nБет даяр болгондон кийин грунтталып, 3–4 сааттан кийин кайра кайталанат.\n\nБет толук кургагандан кийин жылуулоочту төшөй баштайбыз. Эгер пенопласт же экструзияланган пенополистирол (пеноплекс) тандалса, бетин наждак кагаз менен бир аз тырмап коюу сунушталат — бул жылмакайлыгын азайтат.\n\nПолистирол плиталарына шпатель менен клей сүйкөп, жабыштырабыз жана жакшы кургатабыз.\n\nАндан соң перфоратор аркылуу пластик дюбельдер менен кошумча бекитебиз.\n\nДаяр участоктор пластик сетка менен жабыштырылат — ал майда жаракалардын пайда болушун алдын алат. Клейдин толук кургашы үчүн бөлмөдөгү температурага жараша 5–12 саат талап кылынышы мүмкүн.\n\nСетка кургагандан кийин үстүнө шпаклевка катмары түшүрүлөт. Эгер биринчи катмар жетиштүү тегиз кылбаса, кургаганын күтүп кийинки катмарды сүйкөңүз.\n\nКургай баштаган шпаклевка ири данактуу наждак менен иштетилип, кайра грунт катмары сүйкөлөт.\n\nКонструкция кургатылат жана бурчтары шпаклевкаланып бүтүрүлөт.\n\nАкырында, тандаган финиш каптама жасалат: гипсокартон менен каптоо же декоративдик шыбактоо.",
