    "film_installation_text": MessageLookupByLibrary.simpleMessage(
      "Айнек тазаланып, майсыздандырылып, кургатылат — бет жылмакай болушу керек.\nРаманын периметри боюнча эки тараптуу скотч жабыштырылат, андан соң пленканын катмарлары ажыратылат.\nПленка керектүү өлчөмдө кесилип, скотчко жабыштырылат.\nАндан кийин фен менен жылытып, пленканын жыйрылышы жана тегизделиши камсыздалат. Кол менен катуу басууга болбойт.",
