    "film_text_1": MessageLookupByLibrary.simpleMessage(
      "Жылуулукту сактоочу пленка терезе айнегине жабыштырылып, жылуулук жоготууну азайтып, жылуулоо деңгээлин жогорулатат. Пластик терезелер кышында муздак абадан жакшы коргойт, бирок туура жана өз убагында жылууланбаса, катуу суукта көйгөйлөр жаралышы мүмкүн. Жылуу аба сыртка чыгып, муздак аба ным менен кошо ичкери кирип, айнектердин тоңушуна алып келет. Терезени пленка менен жылуулоо — арзан жана натыйжалуу ыкма.\n\nЭнергияны үнөмдөөчү пленка 30% га чейин энергияны үнөмдөөгө жардам берет, айрым түрлөрү жылуулуктун 70% га чейинкисин сактай алат.",
