    "film_text_2": MessageLookupByLibrary.simpleMessage(
      "Бөлмөнү жылуураак кылуу үчүн адегенде бардык жылчыктарды көбүк жана герметик менен жабуу, ошондой эле терезелерди кышкы режимге тууралоо керек. Андан кийин терезелерди энергияны үнөмдөөчү пленка менен жылуулоого болот. Пленка айнектин ички же сырткы бетине жабыштырылат, иштетүүдө ажырабайт жана тунук түрлөрү бөлмөнү караңгылатпайт.",
    ),
    "film_text_3": MessageLookupByLibrary.simpleMessage(
      "Жай мезгилинде ал ультрафиолет нурларын азайтып, бөлмөнү салкын кылат.\nТерезелерди жылуулоочу ПЭТ жана ПВХ пленкалар бар.\nПЭТ — полиэтилентерефталат негизиндеги пластик, ал толук кандуу айнек пакетинин касиеттерине ээ эмес.\nПЭТ пленка адегенде сыртынан, андан кийин ичинен бекитилет.\nОшондуктан жылуулоону жылуу мезгилде баштоо сунушталат.",
