    "insul_install_ceiling_text": MessageLookupByLibrary.simpleMessage(
      "Шыпты барак материалдар менен (ГКЛ, ГВЛ, СМЛ, OSB, фанера ж.б.) кара бүтүрүүдө жылуулук изоляциялоо.\nШыпты барак материалдар менен бүтүргөндө татаал формадагы рельефтүү бет түзүүгө мүмкүнчүлүк болот.\nКронштейндердин аралыгы, саны жана узундугу алдын ала даярдалган долбоорго ылайык, барак жана бүтүрүү катмарларынын салмагын эске алуу менен тандалат.\nГипсокартон орнотуудан мурда жарык приборлорун жана розеткаларды туташтыруу үчүн электр кабелдерди өткөрүп коюу керек. Кабелдер ПВХ/ПНД түтүктөрдө же кабель-каналдарда жүргүзүлүшү зарыл.",
